import React from 'react';
import Header from '../Header/Header';
import FormInput from '../FormInput/FormInput'
import Tasks from '../Tasks/Tasks'
import style from './Form.css'

const Form = ({listItems}) => {
    return(
        <form className={style.form}>
           <Header/>
           <FormInput/>
           <Tasks/>
        </form>
    )
}

export default Form;
